import React, { useState, useEffect } from 'react'
import { api } from './api';

interface Movies {
    title: string;
    original_title_romanised: string;
    description: string;
    release_date: string;
    prevState: null
}

export default function Header() {
    const [movies, setMovies] = useState<Movies[] | null>(null)

    useEffect(() => {
        api.get('/films').then(response => {
            setMovies(response.data)
            console.log(movies)
        })
    }, [])


    return (
        <div>
            <h1>STUDIO GHIBLI</h1>
            <section>{
                movies.map((movie) => {
                <p>{movie.original_title_romanised}</p>
                })
                }</section>
        </div>
    )
}
